catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
	if (isLoading || newValue == '') {
		return;
	}
	var stOperatingHours = g_form.getValue('st_operating_hours');

	if (stOperatingHours > newValue){
		var answer = confirm("The value you provided for operating hours is less than the currently stored value, this will not be updated to the engine record.");
	}

}
